import React from "react";

const Login = () => {


    const onChange = (e) => {
        console.log(e.target);
    }

  return (
    <div className='login_page'>
        <iframe className="login_bgm" frameborder="0" height="100%" width="100%" 
                    src="https://www.youtube.com/embed/U9csZAZUZeI?mute=1&loop=1&autoplay=1&rel=0&controls=0&showinfo=0" allow="autoplay; encrypted-media" allowfullscreen>
                    </iframe>
        <div className='login_box'>

            <input
            className="id_box"
            id="id"
            name="id"
            placeholder="아이디를 입력해주세요"
            onChange={onChange}
            ></input>

            <input
            className="ps_box"
            id="password"
            name="password"
            type="password"
            placeholder="비밀번호를 입력해주세요"
            onChange={onChange}
            ></input>
            <a href="#" className="login_wan_btn">Login</a>
            <p>비밀번호 찾기 / 아이디 찾기</p>

        </div> 
    </div>
  )
}

export default Login
